import axios, { AxiosResponse } from 'axios';
import React from 'react';
import { Apis } from '../shared/apis.consts';
import { SortDirections } from './sort-stocks';
import { Stock, StockAPI, StockAPIConfig } from './stocks-types';
import { STOCK_GET_ACTION } from './stocks.actions';
import { initStockState, stockReducer } from './stocks.reducer';

export const useGetStocks = (
  offset = 0,
  size = 12,
  order: SortDirections = 'asc'
) => {
  const [state, dispatch] = React.useReducer(stockReducer, initStockState);
  const [error, setError] = React.useState<boolean>(false);

  // Market cap is not part of the object, so we need to do new API calls on each sort
  React.useEffect(() => {
    axios
      .post<StockAPIConfig, AxiosResponse<StockAPI>>(Apis.GRID, {
        id: '1',
        no_result_if_limit: true,
        offset: offset * size,
        size,
        state: 'read',
        rules: JSON.stringify([
          ['order_by', 'market_cap', order],
          ['primary_flag', '=', true],
          ['grid_visible_flag', '=', true],
          ['market_cap', 'is_not_null'],
          ['is_fund', '=', false],
        ]),
      })
      .then((res) => {
        const { data } = res.data;
        dispatch({ type: STOCK_GET_ACTION, stocks: data });
      })
      .catch((err) => {
        console.log(err);
        setError(true);
      });
  }, [order, offset, size]);

  return [state.stocks, error] as const;
};
